Ad Text:
This is an exciting opportunity to be at the forefront of AI, Automation and Digital Transformation for one of Queensland’s most respected organisations. You will play a pivotal role in shaping how AI and automation are embedded across the business, improving efficiency, reducing costs and enhancing how customers and employees interact with technology.
 
As the Technical Analyst – AI & Automation, you will act as the critical bridge between business stakeholders, data teams and engineering teams. You will analyse complex processes, uncover opportunities for automation and AI, and translate business needs into high quality technical requirements that enable scalable, future-ready solutions. This role offers strong autonomy, high visibility and the opportunity to influence major transformation initiatives across finance, payroll, customer services and digital channels.
 
You will work across a broad portfolio of initiatives focused on:

Automating transactional processing across corporate functions such as finance, payroll and customer support;
Migrating customers from physical to digital channels including email, SMS, online portals and apps;
Enabling the workforce through modern collaboration tools and BYOD technologies to improve flexibility and reduce operational costs; and
You will bring structure to ambiguity, support solution design, and ensure AI and automation initiatives are grounded in strong analysis, data integrity and business value.
Key Responsibilities

Analyse business processes to identify opportunities for AI, machine learning and automation;
Partner with business SMEs and technical teams to define and document functional and non-functional requirements;
Translate business needs into epics, user stories, workflows and testable acceptance criteria;
Work with data scientists and engineers to define data inputs, outputs, success metrics and transformation rules;
Analyse structured and unstructured data to support AI and automation use cases;
Create source-to-target mappings and support data modelling activities;
Conduct cost-benefit and feasibility assessments for proposed initiatives;
Support Agile delivery practices including story sizing, elaboration and prioritisation;
Coordinate testing, SIT and UAT activities, ensuring business sign-off;
Develop training materials and support knowledge transfer to end users; and
Build strong stakeholder relationships and support clear communication across business and technology teams.
About You
 
You are an experienced Technical Analyst who thrives in complex environments and enjoys working at the intersection of business, data and engineering. You bring strong analytical thinking, excellent communication skills and a genuine interest in AI and automation as drivers of business transformation.
 
You will have:

5+ years’ experience as a Technical Analyst, Business Analyst or Systems Analyst;
Experience working with AI, automation, data analytics or machine learning initiatives;
Strong understanding of system integration, APIs and data flows;
Excellent requirements elicitation and documentation capability;
Strong SQL and data analysis skills, with Python or similar scripting experience highly regarded;
The ability to manage multiple initiatives in a fast-paced environment; and
A proactive, solution-focused mindset with a passion for continuous improvement.
This is a rare opportunity to influence meaningful transformation, work with cutting-edge technologies, and help shape how AI and automation are applied in a large, purpose-driven organisation.

